// Created by Georgina Alacaraz
import { UserContextType, MyPaymentMetadata , CommunityType} from "../components/Types";
import { onCancel, onError, onReadyForServerApproval, onReadyForServerCompletion } from "../components/Payments";
import SignIn from "../components/SignIn";
import Header from "../components/Header";
import Typography from "@mui/material/Typography";
import { UserContext } from "../components/Auth";
import React, { useEffect, useState } from "react";
import MuiBottomNavigation from "../../MuiBottomNavigation";
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { Bloodtype } from "@mui/icons-material";
import { Button, Divider } from "@mui/material";
import {UserData } from "../components/Types";


// Make TS accept the existence of our window.__ENV object - defined in index.html:
interface WindowWithEnv extends Window {
  __ENV?: {
    backendURL: string, // REACT_APP_BACKEND_URL environment variable
    sandbox: "true" | "false", // REACT_APP_SANDBOX_SDK environment variable - string, not boolean!
  }
}

const _window: WindowWithEnv = window;
const backendURL = _window.__ENV && _window.__ENV.backendURL;

const axiosClient = axios.create({ baseURL: `${backendURL}`, timeout: 20000, withCredentials: true});

const config = {headers: {'Content-Type': 'application/json', 'Access-Control-Allow-Origin': '*'}};

export default function  UserToAppPayments() {
  const { user, saveUser, showModal, saveShowModal, onModalClose } = React.useContext(UserContext) as UserContextType;
  const [createCommunityData, setCreateCommunityData] = useState<CommunityType[] | null>(null);
  const [selectedCommunity, setSelectedCommunity] = useState<CommunityType[] | null>(null); // Moved here
  const [userData, setUserData] = useState<UserData | null>(null);
  console.log("User Data :" , userData);
  const navigate = useNavigate();

  const getGreeting = () => {
    const currentHour = new Date().getHours();
    if (currentHour >= 0 && currentHour < 12) {
      return "Good Morning";
    } else if (currentHour >= 12 && currentHour < 18) {
      return "Good Afternoon";
    } else {
      return "Good Night";
    }
  };
  const handleCommunityClick = (community: CommunityType) => {
    // get the community id and make it a current session
    console.log(community._id);
    navigate("/ChatCreator", { state: { communityId: community._id } });
  };

  const handleCommunityClick1 = (community: CommunityType) => {

    console.log(community._id);
    navigate("/Chat", { state: { communityId: community._id } });
  };


  const orderProduct = async (memo: string, amount: number, paymentMetadata: MyPaymentMetadata) => {
    if (user.uid === "") {
      return saveShowModal(true);
    }


    // Define a state to track the selected community

    const paymentData = { amount, memo, metadata: paymentMetadata };
    const callbacks = {
      onReadyForServerApproval,
      onReadyForServerCompletion,
      onCancel,
      onError
    };
    const payment = await window.Pi.createPayment(paymentData, callbacks);
    console.log(payment);
  }
  useEffect(() => {
    console.log(user);
  }
  , [user]);

  useEffect(() => {
    axiosClient.get('/user/me')
      .then((response) => {
        console.log('Response data for /user/me:', response.data);
        // If response.data is an array, we can use forEach
        if (Array.isArray(response.data)) {
          response.data.forEach((community: CommunityType) => {
            if (!community._id) {
              console.error('Community does not have _id:', community);
            }
          });
          setCreateCommunityData(response.data);
        } else {
          console.error('Expected an array for /user/me response data, but got:', response.data);
        }
      })  
      .catch((error) => {
        console.error('Error fetching /user/me:', error);
      });
    }
  , []);



  useEffect(() => {
    axiosClient.get('/user/joined')
      .then((response) => {
        console.log('Joined communities:', response.data);
        setSelectedCommunity(response.data);
      })  
      .catch((error) => {
        console.error('Error fetching joined communities:', error);
      });
  }, []);



  return (
    <>
      <Header />
      <div style={{
        padding: '20px',
        marginBottom: '80px',
        maxWidth: '600px',
        marginLeft: 'auto',
        marginRight: 'auto'
      }}>
        {/* Profile Section */}
        <div style={{ marginBottom: '32px' }}>
          <Typography variant="h5" style={{
            fontWeight: 'bold',
            marginBottom: '16px',
            color: '#4A90E2' // Example primary color
          }}>
            Profile
          </Typography>
          <Typography variant="body1" style={{
            fontSize: '17px',
            marginBottom: '16px',
            fontWeight: 'bold',
            color: '#333' // Darker text for better readability
          }}>
            {getGreeting()} beautiful ðŸ©·
          </Typography>
        </div>

        {/* Your Communities Section */}
        <div style={{ marginBottom: '32px' }}>
          <Typography variant="h6" style={{ marginBottom: '16px', color: '#333' }}>
            Your Communities
          </Typography>
          <div style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(auto-fill, minmax(140px, 1fr))',
            gap: '12px'
          }}>
            {createCommunityData ? createCommunityData.map((community) => (
              <Button
                key={community._id}
                onClick={() => handleCommunityClick(community)}
                variant="contained"
                style={{
                  backgroundColor: '#E1F5FE', // Soft secondary color
                  color: '#0277BD', // Contrast color for text
                  padding: '12px',
                  borderRadius: '30px',
                  textTransform: 'none' // Keep the original text case
                }}
              >
                {community.name}
              </Button>
            )) : (
              <Typography variant="body1">No community data available</Typography>
            )}
          </div>
        </div>

        <Divider style={{ margin: '25px 0' }} />

        {/* Joined Communities Section */}
        <div>
          <Typography variant="h6" style={{ marginBottom: '16px', color: '#333' }}>
            Joined Communities
          </Typography>
          <div style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(auto-fill, minmax(140px, 1fr))',
            gap: '12px'
          }}>
            {selectedCommunity ? selectedCommunity.map((community) => (
              <Button
                key={community._id}
                onClick={() => handleCommunityClick1(community)}
                variant="contained"
                style={{
                  backgroundColor: '#E1F5FE', // Soft secondary color
                  color: '#0277BD', // Contrast color for text
                  padding: '12px',
                  borderRadius: '30px',
                  textTransform: 'none' // Keep the original text case
                }}
              >
                {community.name}
              </Button>
            )) : (
              <Typography variant="body1">No community data available</Typography>
            )}
          </div>
        </div>
      </div>

      {/* SignIn Modal */}
      {showModal && <SignIn onSignIn={saveUser} onModalClose={onModalClose} showModal={showModal} />}

      {/* Bottom Navigation */}
      <MuiBottomNavigation />
    </>
  );
}
